import axios from 'axios'
import React, { useState } from 'react'

function FetchData1() {
    const [user,updateUser]=useState({
        color:'',
        id:'',
        year:'',
         })

    const handleClick=()=>{
        const url='https://reqres.in/api/products/3'
        axios.get(url)
        .then((response)=>{
            console.log(response)
            updateUser(response.data)
        })
        .catch((error)=>{
            console.log(error)
        })
    }

    return (
      <div>
          <button onClick={handleClick} >FetchData</button>
          <div>{user.data.id}</div>
          <div>{user.data.color}</div>
          <div>{user.data.year}</div>
          
      </div>
    );
  }
  
  export default FetchData1;
